import React from 'react';
import { Breadcrumb } from 'antd';
export default function Bread(){
    return(
        <Breadcrumb>
            <Breadcrumb.Item>Home</Breadcrumb.Item>
            <Breadcrumb.Item>
                <a href="">Application Center</a>
            </Breadcrumb.Item>
        </Breadcrumb>
    )

}
